@import "./normalize.css";
:root {
  --color-primary: #2584ff;
  --color-secondary: #00d9ff;
  --color-accent: #ff3400;
  --color-headings: #1b0760;
  --color-body: #918ca4;
  --color-body-darker: #d5cbcc;
  --color-border: #ccc;
  --border-radius: 30px;
}

*,
*::after,
*::before {
  box-sizing: border-box;
}

/* Typography */

::selection {
  background: var(--color-primary);
  color: #fff;
}

html {
  font-size: 62.5%;
}

img {
  width: 100%;
}

body {
  background: var(--color-body);
  font-family: Inter, Arial, Helvetica, sans-serif;
  font-size: 2rem;
  line-height: 1.5;
}

/* h1,
h2,
h3 {
  color: black;
  margin-bottom: 1rem;
  line-height: 1.1;
}

h1 {
  font-size: 6rem;
}

h3 {
  font-size: 2.8rem;
  font-weight: 600;
  line-height: 1.3;
} */

p {
  margin-top: 0;
}

/* Links */

a {
  text-decoration: none;
}

.list {
  list-style: none;
  padding-left: 0;
}

.list--inline .list__item {
  display: inline-block;
  margin-right: 2rem;
}

/* Icons */

.icon {
  width: 80px;
  height: 80px;
}

.icon--small {
  width: 30px;
  height: 30px;
}

.icon--primary {
  fill: var(--color-primary);
}

.icon--white {
  fill: #fff;
}

.icon-container {
  background: #f3f9fa;
  width: 64px;
  height: 64px;
  border-radius: 100%;
  display: inline-flex;
  justify-content: center;
  align-items: center;
}

.icon-container--accent {
  background: var(--color-accent);
}

/* Buttons */

.btn {
  border: 1px solid black;
  border: 0;
  cursor: pointer;
  font-size: 1.8rem;
  font-weight: 600;
  margin: 1rem 0;
  outline: 0;
  padding: 2rem 4vw;
  text-align: center;
  text-transform: uppercase;
  white-space: nowrap;
}

.btn-shadow {
  box-shadow: 5px 5px #1f1f1f;
}
.button {
  margin-right: 2rem;
  width: 121px;
  height: 72px;
  padding: 1rem;
  background: yellow;
}
.footer-buttons {
  margin-bottom: 1rem;
  border-radius: 76px;
  border: 2px solid black;
  padding: 1rem 3rem;
}
.footer-buttons-black {
  background-color: #000;
  color: #fff;
}
.footer-buttons,
.footer-buttons-black {
  font-weight: 600;
}
.footer-buttons-container {
  padding-top: 3rem;
  justify-content: center;
  align-items: center;
  display: flex;
  flex-direction: column;
}
/* Second Footer Div */

.btn-text {
  font-weight: 700;
  padding: 0;
}
.btn .icon {
  width: 2rem;
  height: 2rem;
  margin-right: 1rem;
  vertical-align: middle;
}

.btn--primary {
  background: var(--color-primary);
  color: #fff;
}

.btn--primary:hover {
  background: #3a8ffd;
}

.btn--secondary {
  background: var(--color-secondary);
  color: #fff;
}

.btn--secondary:hover {
  background: #05cdf0;
}

.btn--accent {
  background: var(--color-accent);
  color: #fff;
}

.btn--accent:hover {
  background: #ec3000;
}
/* Email */

.email-container {
  justify-content: center;
  align-items: center;
  vertical-align: middle;
  padding: 0;
  box-shadow: 5px 5px #1f1f1f;
  margin-left: 1rem;
  border: 2px solid black;
  width: 100px;
  height: 72px;
}
.email-padding {
  padding-left: 1rem;
}
.buttons-block {
  justify-content: left;
  align-items: center;
  margin-top: 4rem;
  display: flex;
  flex-direction: row;
}
@media screen and (min-width: 768px) {
  .buttons-block {
    justify-content: center;
    display: flex;
    flex-direction: row;
    padding: 0.5rem 0.5rem;
  }
}
@media screen and (min-width: 1024px) {
  .buttons-block {
    display: flex;
    flex-direction: row;
  }
}
.btn--outline {
  background: #fff;
  color: var(--color-headings);
  border: 2px solid var(--color-headings);
}

.btn--outline:hover {
  background: var(--color-headings);
  color: #fff;
}

.btn--stretched {
  padding-left: 6rem;
  padding-right: 6rem;
}

.btn--block {
  width: 100%;
  display: inline-block;
}

.block-colored {
  padding-left: 10rem;
  overflow: visible;
  position: relative;
  box-shadow: 15px 15px;
  width: 344px;
  height: 286px;
  background-image: linear-gradient(to bottom left, #ff6720, #fe9640);
}
.middle-image {
  flex-grow: 2;
  transform: scaleX(-1);
  position: absolute;
  top: -29px;
  left: 20px;
}
@media screen and (min-width: 1024px) {
  .btn {
    font-size: 1.5rem;
  }
}

/* Inputs */

.input {
  border-radius: var(--border-radius);
  border: 1px solid var(--color-border);
  color: var(--color-headings);
  font-size: 2rem;
  outline: 0;
  padding: 1.5rem 3.5rem;
}

::placeholder {
  color: #cdcbd7;
}

.input-group {
  border: 1px solid var(--color-border);
  border-radius: var(--border-radius);
  display: flex;
}

.input-group .input {
  border: 0;
  flex-grow: 1;
  padding: 1.5rem 2rem;
  width: 0;
}

.input-group .btn {
  margin: 4px;
}

@media screen and (min-width: 1024px) {
  .input {
    font-size: 1.5rem;
  }
}

/* Cards */

.card {
  width: 345px;
  margin: 2rem;
}

.card-top-section {
  display: flex;
  padding: 0.5rem;
  flex-direction: row;
  margin: 1rem 2rem;
}

@media screen and (min-width: 768) {
  .card-top-section {
    display: flex;
    padding: 0.5rem;
    flex-direction: column;
    margin: 1rem 2rem;
  }
}

.card__header,
.card__body {
  padding: 2rem 7%;
}

.card--primary .card__header {
  background: var(--color-primary);
  color: #fff;
}

.card--secondary .card__header {
  background: var(--color-secondary);
  color: #fff;
}

.card--primary .badge--primary {
  background: #126de4;
}

.card--secondary .badge--secondary {
  background: #02cdf1;
}

/* Plans */

.plan {
  transition: transform 0.2s ease-out;
}

.plan__name {
  color: #fff;
  margin: 0;
  font-weight: 500;
  font-size: 2.4rem;
}

.plan__price {
  font-size: 5rem;
}

.plan__billing-cycle {
  font-size: 2rem;
  font-weight: 300;
  opacity: 0.8;
  margin-right: 1rem;
}

.plan__description {
  font-size: 2rem;
  font-weight: 300;
  letter-spacing: 1px;
  display: block;
}

.plan .list__item {
  margin-bottom: 2rem;
}

/* Media */

.media {
  display: flex;
  margin-bottom: 4rem;
}

.media__title {
  margin-top: 0;
}

.media__body {
  margin: 0 2rem;
}

.media__image {
  margin-top: 1rem;
}

/* Quotes */

.quote {
  font-size: 3rem;
  font-style: italic;
  color: var(--color-body-darker);
  line-height: 1.3;
}

.quote__text::before {
  content: open-quote;
}

.quote__text::after {
  content: close-quote;
}

.quote__author {
  font-size: 2rem;
  font-weight: 500;
  font-style: normal;
  margin-bottom: 0;
}

.quote__organization {
  color: var(--color-headings);
  opacity: 0.4;
  font-size: 1.5rem;
  font-style: normal;
}

.quote__line {
  position: relative;
  bottom: 10px;
}

@media screen and (min-width: 1024px) {
  .quote {
    font-size: 2rem;
  }
  .quote__author {
    font-size: 2.4rem;
  }
  .quote__organization {
    font-size: 1.6rem;
  }
}

/* Grids */

.grid {
  display: grid;
}

@media screen and (min-width: 768px) {
  .grid--1x2 {
    grid-template-columns: repeat(2, 1fr);
  }
}

@media screen and (min-width: 1024px) {
  .grid--1x3 {
    grid-template-columns: repeat(3, 1fr);
  }
}

.container {
  padding: 2rem;
  justify-content: left;
  align-items: center;
  display: flex;

  flex-direction: column;
}
.footer-container {
  justify-content: center;
  align-items: center;
  display: flex;

  flex-direction: column;
}
@media screen and (min-width: 768px) {
  .container {
    justify-content: center;
    align-items: center;
    display: flex;
    flex-direction: row;
  }

  .footer-container {
    justify-content: center;
    align-items: center;
    display: flex;

    flex-direction: row;
  }
}

@media screen and (min-width: 1024px) {
  .container {
    justify-content: center;
    align-items: center;
    display: flex;
    flex-direction: row;
  }

  .footer-container {
    justify-content: center;
    align-items: center;
    display: flex;

    flex-direction: row;
  }
}
/* Collapsibles */

.collapsible__header {
  display: flex;
  justify-content: space-between;
}

.collapsible__heading {
  margin-top: 0;
  font-size: 3rem;
}

.collapsible__chevron {
  transform: rotate(-90deg);
  transition: transform 0.3s;
}

.collapsible__content {
  max-height: 0;
  overflow: hidden;
  opacity: 0;
  transition: all 0.3s;
}

.collapsible--expanded .collapsible__chevron {
  transform: rotate(0);
}

.collapsible--expanded .collapsible__content {
  max-height: 100%;
  opacity: 1;
}

/* Blocks */

.block {
  --padding-vertical: 5rem;
  padding: var(--padding-vertical) 2rem;
}

.block__header {
  text-align: left;
  margin-bottom: 2rem;
}

.block__heading {
  line-height: 1.1;
  margin-top: 0;
  font-size: 3rem;
  font-weight: 700;
  color: #000;
}

@media screen and (min-width: 1024) {
  .block__heading {
    margin-top: 0;
    font-size: 6rem;
    font-weight: 700;
    color: #000;
  }
}
.block__body {
  margin-top: 0;
  font-size: 2rem;
}

/* Navigation Bar */

.nav {
  background: var(--color-body);
  display: flex;
  justify-content: space-between;
  flex-wrap: wrap;
  padding: 1rem;
  align-items: center;
}

.nav__list {
  width: 100%;
  margin: 0;
}

.nav__item {
  padding: 0.5rem 2rem;
  border-bottom: 1px solid #222;
}

.nav__item:last-of-type {
  border-bottom: none;
}

.nav__item > a {
  color: #d2d0db;
  transition: color 0.3s;
}

.nav__item > a:hover {
  color: #fff;
}

.nav__toggler {
  opacity: 0.5;
  transition: box-shadow 0.15s;
  cursor: pointer;
}

.nav.collapsible--expanded .nav__toggler {
  opacity: 1;
  box-shadow: 0 0 0 3px #666;
  border-radius: 5px;
}

.nav__brand {
  transform: translateY(5px);
  width: 150px;
}

@media screen and (min-width: 768px) {
  .nav__toggler {
    display: none;
  }
  .nav__list {
    width: auto;
    display: flex;
    font-size: 1.6rem;
    max-height: 100%;
    opacity: 1;
  }
  .nav__item {
    border: 0;
  }
}

.footer__colored-section {
  overflow: visible;
  color: #fff;
  position: relative;
  margin-top: 3rem;
  box-shadow: 15px 15px #1f1f1f;
  padding: 2rem;
  background-image: linear-gradient(to bottom right, #0b6149, #074b42);
}
.team {
  color: #000;
  position: absolute;
  left: 48px;
  top: -13px;

  display: inline;
  font-weight: 500;
  font-size: 1rem;
  background: yellow;
  padding: 0.5rem 1rem;
}

.footer__body {
  color: #fff;
  font-weight: 400;
  font-size: 2rem;
  line-height: 1.5;
  padding-bottom: 1rem;
}
.work {
  padding-bottom: 1rem;
  display: inline;
  border-bottom: 1px solid #fff;
}

.images > img {
  display: inline-block;
  border: solid 2px #fff;
  border-radius: 50%;
  width: 30px;
  height: 30px;
  overflow: hidden;
}

.image1 {
  position: absolute;
  top: 11px;
  left: 10;
}
.image2 {
  position: absolute;
  top: 11px;
  left: 18px;
}
.image3 {
  position: absolute;
  top: 11px;
  left: 39px;
}
.dev-container {
  position: relative;
  display: inline;
}
.round-circle {
  position: relative;
}
.dev-container::after {
  content: "Meet Our Developers";
  font-size: 1rem;
  padding-top: 1rem;
  padding-left: 9rem;
  position: relative;
  top: 10px;
  left: 0;
}

.footer-last {
  background: #fedd19;
  box-shadow: 15px 15px #1f1f1f;
}
.footer-last-text1 {
  font-size: 3.2rem;
  font-weight: 700;
  padding: 0 2rem;
}
.footer-last-text {
  letter-spacing: -1px;
  color: #000;
  padding: 2rem;
  font-weight: 500;
  font-size: 3rem;
}
.footer-last-container {
  margin: 2rem;
}

@media screen and (min-width: 768px) {
  .footer {
    font-size: 1.5rem;
  }
}

/* Sign-up Callout */

.callout-signup {
  transform: translateY(5rem);
}
